import React, { Component } from 'react';

class SchoolStatistics extends Component {
    render() {
        let schoolStatList = []
        return (
            <div class="jumbotron m-3 shadow p-3">
                <div className="row p-3">
                    {schoolStatList}
                    <div className="card" style={{width: '10rem'}}>
                      <div className="card-body">
                        <h5 className="card-title">Attendance</h5>
                        <h6 className="card-subtitle mb-2 text-muted">Overall Numbers:</h6>
                        <p className="card-text">
                          School: 93% <br></br>
                          Tardy: 15% <br></br>
                          ISS: 10% <br></br>
                        </p>
                        <a href="/#" className="card-link">View Breakdown</ a>
                      </div>
                    </div>
                    
                </div>
                

            </div>
        );
    }
}

export default SchoolStatistics;
